import { getAction } from '@/api/manage';
import SysFillRuleModal from './modules/SysFillRuleModal';
import { JeecgListMixin } from '@/mixins/JeecgListMixin';
export default {
  name: 'SysFillRuleList',
  mixins: [JeecgListMixin],
  components: {
    SysFillRuleModal: SysFillRuleModal
  },
  data: function data() {
    return {
      description: '填值规则管理页面',
      // 表头
      columns: [{
        title: '#',
        dataIndex: '',
        key: 'rowIndex',
        width: 60,
        align: 'center',
        customRender: function customRender(t, r, index) {
          return 1 + index;
        }
      }, {
        title: '规则名称',
        align: 'center',
        dataIndex: 'ruleName'
      }, {
        title: '规则Code',
        align: 'center',
        dataIndex: 'ruleCode'
      }, {
        title: '规则实现类',
        align: 'center',
        dataIndex: 'ruleClass'
      }, {
        title: '规则参数',
        align: 'center',
        dataIndex: 'ruleParams'
      }, {
        title: '操作',
        dataIndex: 'action',
        align: 'center',
        scopedSlots: {
          customRender: 'action'
        }
