      var closeLoading = this.$message.loading('生成中...', 0);
      getAction(this.url.test, {
        ruleCode: record.ruleCode
      }).then(function (res) {
        if (res.success) {
          _this.$info({
            title: '填值规则功能测试',
            content: '生成结果：' + res.result
          });
        } else {
          _this.$message.warn(res.message);
        }
      }).finally(function () {
        closeLoading();
      });
    }
  }
};
